const Game = ({ name }) => {
  return (
    <Grid 
        width={320}
        gap={24}
        align='center'>
        <Grid.Item span={2}>
          <Label htmlFor='width'>width {props.width}</Label>
        </Grid.Item>
        <Grid.Item span={2}>
          <Label htmlFor='width'>gap {props.gap}</Label>
        </Grid.Item>

    </Grid>
  )
}

export default Game
